INSERT INTO `BLC_PAGE_FLD` (`PAGE_FLD_ID`, `CREATED_BY`, `DATE_CREATED`, `DATE_UPDATED`, `UPDATED_BY`, `FLD_KEY`, `LOB_VALUE`, `VALUE`, `PAGE_ID`) VALUES (1,NULL,NULL,'2016-08-14 10:38:23',-1,'body','<p>How amazing would it feel to have a new dress any time you want it? Think this and then think that all this happens at a fraction of cost of those dresses!\r\n</p>\r\n<p>We at FitnFash believe in providing affordable luxury to you offering clothes on rent for all your special occasions. Find all the latest ethnic, indo-western and western wear in our closet. Choose to be a fashionista everytime you walk out of your door.\r\n</p>\r\n<p>We are strong believers of the idea that we don’t have to own a piece of cloth to enjoy its luxury. We completely believe that cloth-renting solutions will bring about a remarkable change in the way we consume them and how it impacts the environment.\r\n</p>\r\n<p>Place a booking request online, we will deliver the dress at your doorstep and even pick it back after the event.\r\n</p>\r\n<p>Hygiene? Never even worry about it. We are an immaculate breed. Rest assured, every dress reaching you is dry cleaned and ready to wear.\r\n</p>',NULL,1),(2,NULL,NULL,'2016-08-14 10:38:23',-1,'title',NULL,'About Us',1),(3,NULL,NULL,'2016-08-14 10:37:37',-1,'body','<dl>\r\n	<dt>+  How do we use FitnFash?</dt>\r\n	<dd>\r\n	<p> It is simple! Just select the date to wear and book the available dress of your choosing. You will also get an option of selecting an alternative wear. You can opt to get a free demo of the dress(es)\r\n	</p>\r\n	<p>If your dress is customizable, we will take your measurements the same day as the demo and get the chosen dress tailor-fitted for you. For non-customizable dresses, we will only come and show you the real dress, thus, demo is optional for them\r\n	</p>\r\n	<p>The dress will be delivered one-day in advance of the event date\r\n	</p>\r\n	<p>Adorn your favourite dress on your special occasion. We will come to pick it back after one day of the event date.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What is the difference between Product Retail Price and its Rental Price?</dt>\r\n	<dd>\r\n	<p> The Product Retail Price is how much the dress costs in the market, while its Rental Price is the one time usage amount for that dress. In other words, Rental price is the amount for which we are making that dress available to you for one-time wear.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What is the minimum time before which I can book a dress?</dt>\r\n	<dd>\r\n	<p> Make sure you book a customizable ethnic dress at least 3 days before the event date, this is because we want one day for demo and fitting details, one day for getting it custom-fitted and one day for advance delivery\r\n	</p>\r\n	<p>A non-customizable outfit should ideally be booked 2 days prior to the even date, this is for demo and delivery. In case you don’t need a demo, then 1 day advance booking is also available.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What if I accidentally stain or damage a dress?</dt>\r\n	<dd>\r\n	<p> It totally depends on the kind of damage done to it. If it is just a regular damage which is expected with a wear, like a button/sequin/thread falling off, we will not charge anything from you and the entire security deposit will be refunded. But for a substantial loss, like staining beyond repair or tearing the dress, all of the security deposit will be charged.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  How do you clean the outfit before it arrives?</dt>\r\n	<dd>\r\n	<p> Each and every dress, once picked back from a customer is sent for hygiene wash and dry-cleaning. No dress is shown available for booking without being dry-cleaned first.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  Can I make cash payments for booking a dress with FitnFash?</dt>\r\n	<dd>\r\n	<p> No, we only accept online modes of payment: debit/credit card and netbanking.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  How long do I get to keep the outfit?</dt>\r\n	<dd>\r\n	<p> The booked dress will be delivered to you one day before the event date. And the pick-up is arranged one day after the event date.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What if I need an outfit for a longer period?</dt>\r\n	<dd>\r\n	<p> We have a fixed period of dress locking with a customer. But if there is a special need, you can call us and we will try our best to accommodate your request to increase the time period.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What if I still end up with an outfit that doesn’t fit me?</dt>\r\n	<dd>\r\n	<p> Non-customizable ethnic and Western wear comes with a standard size chart and the dress of selected size will be delivered to you\r\n	</p>\r\n	<p>In case of customizable ethnic wear, if you are not satisfied with the fittings, you can raise alarm at the time of delivery and write back to our customer care at info@fitnfash.com. We will make sure that we get the dress fitted again and deliver it back on or before the event date.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What if I change my mind after making a booking? Can I cancel it?</dt>\r\n	<dd>\r\n	<p> Yes you can cancel it anytime before the demo is completed. Once the demo is completed, and you attempt to cancel it, then we will charge you a minimum cancellation fee, as per our policy.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  Will my money be refunded for a cancelled order?</dt>\r\n	<dd>\r\n	<p> All your money will be refunded if the booking is cancelled before the demo of the dress is completed.\r\nIf you cancel your booking after we have completed a demo, then a minimum cancellation charges will be levied on you and the rest of the money will be refunded to your account.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What if I want to change the event date (for which the booking has already been made)?</dt>\r\n	<dd>\r\n	<p> You can cancel your existing order and make a fresh booking for the new event date. Although in such a case there is a possibility that the same dress might not be available for that day!\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What time will my outfit reach me?</dt>\r\n	<dd>\r\n	<p> The delivery boy will contact you and attempt the dress delivery one day prior to the event date at the time of your convenience.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  How do I return my outfit?</dt>\r\n	<dd>\r\n	<p> The Pick-up boy will contact you and attempt to pick the dress one day after the event date at the time of your convenience.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  Can my outfit be picked back from another address (to which it wasn’t initially booked)?</dt>\r\n	<dd>\r\n	<p> Yes, it is possible. Mark a mail to our customer care info@fitnfash.com mentioning your Order number and new pick up address at least one day in advance. We will arrange it.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  Can I reschedule delivery?</dt>\r\n	<dd>\r\n	<p> This is not possible since the delivery of  a dress is related to its event date. And to change your event date you have to cancel your existing order and create a new order.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What is the purpose of Demo of dress(es)?</dt>\r\n	<dd>\r\n	<p> We schedule demo of the booked dress and the alternative wear mainly for the following reasons:\r\nSo you have a feel of the fabric and how it looks.\r\nSo you can select between the chosen dress and alternative wear.\r\nIn case of customizable outfit, we will take your measurements and deliver the finished dress.\r\n	</p>\r\n	</dd>\r\n</dl>\r\n<dl>\r\n	<dt>+  What if the alternative wear i choose has a higher price than the main dress and I choose to go for alternate wear after demo?</dt>\r\n	<dd>\r\n	<p> If you choose to go for alternative wear with a higher price then you can avail it for delivery only after online payment of the difference in amount.\r\n	</p>\r\n	</dd>\r\n</dl>',NULL,2),(4,NULL,NULL,NULL,NULL,'body',NULL,'<h2 style=\"text-align:center;\">This is an example of a content-managed page.</h2>',3),(1000,-1,'2016-04-04 13:07:17','2016-04-04 13:07:17',NULL,'title',NULL,NULL,3),(1050,-1,'2016-08-14 10:37:37','2016-08-14 10:37:37',NULL,'title',NULL,'FAQs',2);
/*!40000 ALTER TABLE `BLC_PAGE_FLD` ENABLE KEYS */;
UNLOCK TABLES;

